import logo from './logo.svg';
import './styles/App.css';

function App() {
  return (
    <>
      <Header />
      <Row>
          <Search />
          <DisplayPic />
      </Row>
      <Upload />
      <Video />
      <Title />
      <SubTitle />
      <Description />
      <Comments />
      <NextVideos />
    </>
  );
}

export default App;
